import React from "react";
import Navbar from "../Navbar/Navbar";
import shopping from "../../img/shopping.jpg";

function Home() {
  return (
    <>
      <Navbar />
     <section>
      <img src={shopping} alt="error" className="banner_img" />
      </section>
    </>
  );
}

export default Home;
